export default {
	artist: searchArtist.text ?? selectArtist.selectedOptionLabel,

	clearStorage: async () => {
		Object.keys(appsmith.store).forEach((eachKey) => {
			storeValue(eachKey, undefined)	
			showAlert(eachKey)
		})
		await console.log(appsmith.store)
	},

	clearAuthCode: () => {
		storeValue('authToken', 'undefined')
		showAlert(appsmith.store.authToken)
	},

	displayStoredValues: () => {
		console.log(appsmith.store)
	}
}
